INSERT INTO resemblegame VALUES(DEFAULT, 'Viderekommen', 'I Denne oppgaven er det 3 deloppgaver som basseres på at brukeren har gode kunnskaper innen HTML5 og CSS', 'Å kunne kode noe vanskelige nettsider ved hjelp av HTML5 og CSS. ', 2, 'SYSTEM');
INSERT INTO resemblegame VALUES(DEFAULT, 'Øving 3 Del 1', 'I Denne oppgaven vil man også bli testet om man får til å implementere enkle nettsider med en standard layout ved å bruke basic CSS og HTML', 'Lære seg veldig enkel HTML og CSS layout', 3, 'SYSTEM');
INSERT INTO resembletask VALUES(DEFAULT, 'Skriv “Jeg skal være rød” som overskrift. “Jeg skal være blå” er vanlig tekst. Style dem i riktige farger og gjør bakgrunnen gul.', '<!DOCTYPE html><html><body><h1>Jeg skal være rød</h1><p>Jeg skal være blå</p></body></html>', 'p{color: blue;}h1{color: red;}body{background-color: yellow;}', '<!DOCTYPE html><html></html>', '', 200, 150, 3);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag en overskrift og en tekst som vist i fasiten. Gjør teksten “høyrestilt” høyrestilt. Gjør den også fet med skriftstørrelse 12.', '<html><body><h1>Overskrift</h1><p>Høyrestilt tekst<p></body></html>', 'p{float: right;font-size: 12pt;font-weight: bold;}', '<!DOCTYPE html><html></html>', '', 200, 150, 3);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag en tabell med to rader og to kolonner med teksten ”Celle #”. Gjør bakgrunnen i cellene rød.', '<html><body><table><tr><td>Celle 1</td><td>Celle 2</td></tr><tr><td>Celle 3</td><td>Celle 4</td></tr></table></html>','tr {background-color: red;}', '<!DOCTYPE html><html></html>', '', 150, 100,3);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag et vindu med en overskrift og tre avsnitt med henholdsvis fet tekst, kursiv tekst og gjennomstreket tekst. Hvert avsnitt skal ha rød tekst.', '<!DOCTYPE html> <html><body><h1>Overskrift</h1> <p><b> Fet tekst </b></p> <p><i> Kursiv </i></p><p><s> Gjennomstreket tekst </s></p> </body> </html>', 'p {color: red}', '<!DOCTYPE html> <html> <body> </body> </html>', '', 200, 150, 1);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag et vindu med en nøstet liste med der en liste skal være uordnet og inneholde "Campuser ved HiST". Den andre listen skal være ordnet og inneholde "Campuser ved NTNU". Bakgrunnen skal være "blue", fargen på hvert element i listene skal være "white", bortsett fra "Campuser ved NTNU" som skal være "red". ', '<!DOCTYPE html> <html> <body> <div id="Background"> <ul> <li> Campuser ved HiST <ul> <li>Kalvskinnet</li><li>Øya</li> <li>Elgeseter</li> </ul> </li> <li style="color: red;"> Campuser ved NTNU <ol> <li>Gløshaugen</li> <li>Dragvoll</li> <li>Moholt</li> </ol> </li> </ul> </div> </body> </html>', '#Background{ background-color: blue;} li {color: white;}', '<!DOCTYPE html> <html> <body> <div> </div> </body> </html>', 'li {/* Hva skal inn her? */}', 200, 150, 1);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag et vindu med en overskrift og en tabell med følgende kriterier: Overskriften skal bruke 15% av Ditt-resultat-vinduet. Teksten skal også være blå, plassert til høyre, med font-stylen "oblique". Tabellen skal ha en border på størrelse 3, bruke full bredde, cellpadding = 2, og cellspacing = 3. Videre skal hodet i tabellen være farget rødt, Bodyen skal være hvit og footen grønn. ', '<!DOCTYPE html> <html> <body> <table border="3" width="100%" cellpadding="2" cellspacing="3"> <div id="top"> Prisoversikt </div>  <thead> <tr> <th>Artikkel</th> <th> Pris </th> </tr> </thead><tfoot> <tr> <th>Totalt</th> <th>25 kr</th> </tr> </tfoot> <tbody> <tr> <td> Sjokolade</td> <td>10 kr</td> </tr> <tr> <td> Melk</td> <td>15 kr</td> </tr> </tbody> </table> </body> </html>', 'thead {background-color: red;}  tbody {background-color: white;} tfoot {background-color: green; } #top { float: right;  height: 15%; color: blue;font-style: oblique; }', '<!DOCTYPE html> <html><body> <table> <div> </div> <thead> <tr> <th> </th> </tr> </thead> <tfoot>  </tfoot> <tbody> </tbody> </table> </body></html>', 'tfoot { } #top { color: blue; }', 200, 150, 1);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag et vindu med en hoveddel (høyde 70%) og bunn (høyde 30%). I hoveddelen skal det være tre lenker (VG.no, Hist.no og Adressa.no). Lenkene trenger kun å referere til feks. "#". Bunnen skal være svart med hvit tekst. Teksten skal være sentrert. ', '<!DOCTYPE html> <html> <body> <div id=''mid''> <ul> <li><a href=''#''>VG.no</a> </li> <li><a href=''#''>Hist.no</a> </li> <li><a href=''#''>Adressa.no</a> </li> </ul> </div> <div id=''bottom''>Bunn</div> </body> </html>', '#mid { background-color: gray; height: 70%; width: 100%; } ul { float: left; } #bottom { text-align: center;  color: white; background-color: black; height: 30%; width: 100%; }', '<!DOCTYPE html> <html> <body> </body> </html>', '#mid { height: 70%; } ul { float: left;} #bottom { height: 30%; }',  200, 150, 2);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag en tabell som fyller hele vinduet. Tabellen skal ha cellspacing = 0 og gul bakgrunn. Overskriften er en rekke i tabellen og har høyde 20%. Resten av elementene i tabellen er 4 liker store knapper. ', '<html> <body> <form> <table cellspacing=''0''> <tr> <td style=''height: 20%'' colspan=''2''>Dette er et spørsmal</td> </tr><tr> <td> <button id=''button''>Nr 1</button> </td> <td> <button id=''button''>Nr 2</button> </td> </tr> <tr> <td> <button id=''button''>Nr 3</button> </td> <td> <button id=''button''>Nr 4</button> </td> </tr> </table> </form> </body> </html>', 'table { height: 100%; width: 100%; background-color: yellow; text-align: center; }  #button { height: 100%; width: 100%; }', '<!DOCTYPE html><html> <body> <form> <table> <tr> <td colspan=''2''>Dette er et spørsmal</td> </tr> </table> </form> </body> </html>', 'table { } #button { height: 100%; width: 100%; }', 200, 150, 2);
INSERT INTO resembletask VALUES(DEFAULT, 'Lag et vindu med en topp og en bunn. Bakgrunnen på hele vinduet skal være hvit. I toppen skal det legges inn et bilde (lenken ligger i HTML-koden). I bunnen skal det være en tekst (størrelse 10 px) og en tekst-boks som allerede skal være fylt med tekst. ', '<html> <body> <div id=''wrapper''> <div id=''top''> <img src=''http://intuitiontosucceed.academy/wp-content/uploads/2014/06/K2_Mount_Godwin_Austen_Chogori_Savage_Mountain1-1080x675.jpg''/> </div> <div id=''bottom''> <br> Hva ser du på bildet?</br> <input value=''Et fjell''/> </div> </div> </body> </html>','#wrapper { background-color: white; } #top {  height: 60%; } #bottom { font-size: 10px;  height: 40%;} img { width: 100%; height: 100%; }', '<!DOCTYPE html><html><body>LINK: http://intuitiontosucceed.academy/wp-content/uploads/2014/06/K2_Mount_Godwin_Austen_Chogori_Savage_Mountain1-1080x675.jpg </body></html>', '#wrapper { } #top {  height: 60%; } #bottom { height: 40%;}', 200, 150, 2);
